    const contentStyle = {
        color: "blue",
        fontSize: "20px"
    };

    // ピンク用に追加
    const contenPinkStyle = {
        color: "pink",
        fontSize: "20px"
    };

    return (
        <>
        <h1 style={{ color: "red"}}> こんにちは! </h1>
        <p style={contentStyle}> お元気ですか？ </p>
        p
        <button onClick={onClickButton}> ボタン </button>
        </>
        );
    };
